import './App.css';

import React, { Component } from 'react'
import { getRandomColor } from './Utils';


var initialValues = [
  {
    value: '1', 
  },
  {
    value: '2', 
  },
  {
    value: '3', 
  },
  {
    value: 4, 
  },
  {
    value: 5, 
  },
  {
    value: 6, 
  },
  {
    value: 7, 
  },
  {
    value: 8, 
  },
  {
    value: 9, 
  },
]


export default class App extends Component {

  state = {
    valueSelect: 0,
    tabValues: []
  }

  render() {

    let numberComponent = (couleur, valeur) => {

      return <div className='text-center pt-2' style={{ height: "60px", width: "60px", fontSize: "30px", backgroundColor: couleur }} > {valeur} </div>


    }

    return (

      <div className='container mt-3 px-4 '>
        <div className=' flex-row bg-warning'>
          <div style={{ fontSize: "20px" }} className='mr-4 float-start text-14'>
            123 Game
          </div>
          <button className='btn btn-primary btn-sm float-end'> New game</button>
        </div>
        <br />
        <br />
        {
          initialValues.map(item => {  
            numberComponent(getRandomColor,item.value)
          })
        }
        {numberComponent("#f77", 2)}
      </div>
    )
  }
}
